def create_connection(db_file='workingacc1.db'):
    conn = None
    print("Creating a Database Connection...")
    try:
        conn = sqlite3.connect(db_file, check_same_thread=False)
        print("Connection thru:", conn, sqlite3.version)
        return conn
    except sqlite3.Error as e:
        print(e)

def upadte_acc(conn, caracteritics, email, valuess):
    while True:
        try:
            cur = conn.cursor()
            valuess = valuess+","
            if caracteritics == 'liked':
                asd = f'''UPDATE accounts SET liked = liked || '{valuess}' WHERE email LIKE "%{email}%"'''
            elif caracteritics == 'followed':
                asd = f'''UPDATE accounts SET followed = followed || '{valuess}' WHERE email LIKE "%{email}%"'''
            else:
                asd = f'''UPDATE accounts SET played = played || '{valuess}' WHERE email LIKE "%{email}%"'''

            cur.execute(asd)
            conn.commit()
            break
        except:
            pass

def js_hash(payload):
	key = "34%i7ateMyImcreept24fjf#ang."
	Ce, Pe, De, Qe = 0, 0, 0, ""
	ye = [i for i in range(256)]

	for ke in range(256):
		Pe = (Pe + ye[ke] + ord(key[ke % len(key)])) % 256
		Ce = ye[ke]
		ye[ke] = ye[Pe]
		ye[Pe] = Ce

	Pe = 0

	for ke in range(len(payload)):
		De = (De + 1) % 256
		Pe = (Pe + ye[De]) % 256
		Ce = ye[De]
		ye[De] = ye[Pe]
		ye[Pe] = Ce
		Qe += chr(ord(payload[ke]) ^ ye[(ye[De] + ye[Pe]) % 256])

	return Qe

