def Logon_request(file):
    
    s = requests.session()
    s.headers = {
        "Accept": "text/html,application/xhtml+xml,application/xml;q=0.9,"
                "image/avif,image/webp,image/apng,*/*;q=0.8,"
                "application/signed-exchange;v=b3;q=0.9",
        "Content-Type": "application/x-www-form-urlencoded",
        "User-Agent": "Mozilla/5.0 (Windows NT 10.0; Win64; x64) "
                    "AppleWebKit/537.36 (KHTML, like Gecko) "
                    "Chrome/103.0.0.0 Safari/537.36",
        "Origin": "https://www.anghami.com",
        "Referer": "https://www.anghami.com/",
        "Accept-Language": "en-US,en;q=0.9",
        "Accept-Encoding": "gzip, deflate, br"
    }
    proxies = {
            'http': 'http://sp24933849:sp24933849@eu.dc.smartproxy.com:20000',
            'https': 'http://sp24933849:sp24933849@eu.dc.smartproxy.com:20000',
            }
    s.proxies.update(proxies)
    s.get("https://www.anghami.com/")

    session_uuid = uuid4()
    session_hash = b64encode(js_hash(session_uuid))

    params = {
        "fp": session_uuid,
        "hash": quote_plus(session_hash),
        "type": "POSTfingerprint",
        "language": "en",
        "lang": "en",
        "web2": "true",
        "fingerprint": "",
        "angh_type": "POSTfingerprint"
    }

    response = s.get(
        "https://api.anghami.com/gateway.php",
        params=params,
        headers={
            "Accept": "application/json, text/plain, */*"
        }
    )

    assert response.ok, response.reason
    assert response.json()["status"] == "ok", response.json()["status"]

    session_fingerprint = response.json()["fingerprint"]
    with open('cookies//{}cookies.pkl'.format(file), 'rb') as f:
        xookies = pickle.load(f)
        xookies = xookies.get_dict()
        xookies['fingerprint'] = session_fingerprint
        s.cookies.update(xookies)
        session_sid= unquote_plus(xookies['appsidsave'])
    r = s.get('https://play.anghami.com/home')
    #print(r.json())
    #assert r.ok, r.reason
    #assert r.json().get("status") == "ok"
    return s, session_fingerprint, session_sid, session_uuid

