def Actionghami(conn, action, cookie, song_id, artist_id, id):
    sema.acquire()
    s, session_fingerprint, session_sid, session_uuid = Logon_request(strip_cook(cookie))
    if action == "like":
        like_song(s, song_id, session_fingerprint, session_sid)
        print(f"Liked  {song_id} with {strip_cook(cookie)} # {id}")
        upadte_acc(conn, 'liked', strip_cook(cookie), song_id)
    if action == "follow":
        follow_artist(s, artist_id, session_uuid, session_sid)
        print(f"Followed  {artist_id} with {strip_cook(cookie)} # {id}")
        upadte_acc(conn, 'followed', strip_cook(cookie), artist_id)
    if action == "play":
        play_song(s, song_id, session_fingerprint, session_sid)
        print(f"Played {strip_cook(cookie)} # {id}")
        upadte_acc(conn, 'played', strip_cook(cookie), song_id)
    sema.release()

def do_threads(th, total_of, start=None):
    print('-TOTAL FETCHED:', len(th))
    if start is None:
        start = 0
    if total_of is None:
        total_of = len(th)
    else:
        total_of = total_of + start
    for t in range(start, total_of):
        th[t].start()
    for t in range(start, total_of):
        th[t].join()    

